// Function to check if word exists in KBBI
function isWordInKBBI(word) {
    return KBBI_DATABASE.includes(word.toUpperCase());
}

// Function to get random KBBI words for suggestions
function getRandomKBBIWords(count = 5) {
    const shuffled = [...KBBI_DATABASE].sort(() => 0.5 - Math.random());
    return shuffled.slice(0, count);
}

// Export for use in main.js
window.KBBI = {
    isWordInKBBI,
    getRandomKBBIWords,
    database: KBBI_DATABASE
}; 